unsigned l_uPublicKeyArraySize = sizeof(l_uPublicKeyArray) / sizeof(l_uPublicKeyArray[0]);

bool g_KSGEncodeDecode(BYTE *pbyBuffer, DWORD uSize, DWORD *puKey)
{
    int    nResult  = false;
    DWORD *puBuffer = (DWORD *)pbyBuffer;
    DWORD  uKey     = *puKey;
    DWORD  uRemains = uSize % 4;

    KG_PROCESS_PTR_ERROR(pbyBuffer);

    uSize /= 4;

    while (uSize-- > 0)
    {
        uKey = l_uPublicKeyArray[(uSize + uKey) % l_uPublicKeyArraySize] + 778904513;
        *puBuffer++ ^= uKey;
    }

    pbyBuffer = (BYTE *)puBuffer;
    uKey ^= l_uPublicKeyArray[uRemains % l_uPublicKeyArraySize];

    while (uRemains-- > 0)
    {
        *pbyBuffer++ ^= (BYTE)(uKey & 0xff);
        uKey >>= 8;
    }

    *puKey = (*puKey * 31) + 134775813L;

    nResult = true;
Exit0:
    return nResult;
}

bool KG_KSGCode::Encode(BYTE *pbyBuff, DWORD uSize, DWORD *puKey)
{
    DWORD uKey = *puKey;
    return g_KSGEncodeDecode(pbyBuff, uSize, &uKey);
}

bool KG_KSGCode::Decode(BYTE *pbyBuff, DWORD uSize, DWORD *puKey)
{
    DWORD uKey = *puKey;
    return g_KSGEncodeDecode(pbyBuff, uSize, &uKey);
}

